import React from "react";
import {Container,Navbar,NavDropdown,Nav, Col,Row, Button} from "react-bootstrap"
import logo from './logo.png'
function Home1(){
    return(
        <div>
<Container fluid className=" black1">
<Container className=" text-white ps-0 pt-2 pb-2 w-75 black " >
    <span>Free shipping, 30-day return or refund guarantee.</span> 
    <span style={{float :'right'}}>
<ul className="text-end fs-6">
    <li>SIGN IN</li>
    <li>FAQs</li>
    <li>USD</li>
</ul>
   </span>
</Container>
</Container>
<Container fluid>
    <Container  className="nb ps-0 pe-0 w-75 navbar">       
<Navbar className="w-100" expand="lg">
        <Navbar.Brand ><img src={logo}/></Navbar.Brand>
         <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="m-auto ">
            <Nav.Link >Home</Nav.Link>
            <Nav.Link >Shop</Nav.Link>
            <NavDropdown className="dd" title="Pages" >{$(document).ready(function(){
    $(".dropdown").hover(function(){
        var dropdownMenu = $(this).children(".dropdown-menu");
        if(dropdownMenu.is(":visible")){
            dropdownMenu.parent().toggleClass("open");
        }
    });
}) }
              <NavDropdown.Item className="dl" href="#action/3.1">About Us</NavDropdown.Item>
              <NavDropdown.Item className="dl" href="#action/3.2">
                Shopping details
              </NavDropdown.Item>
              <NavDropdown.Item className="dl">Shopping Cart</NavDropdown.Item>
              <NavDropdown.Item className="dl">Check Out</NavDropdown.Item>
              <NavDropdown.Item className="dl">Blog Details</NavDropdown.Item>
            </NavDropdown> 
            <Nav.Link >Blog</Nav.Link>
            <Nav.Link >Contacts</Nav.Link>            
    </Nav>
      <Nav className="ms-auto">
            <Button >search</Button>
            </Nav>
    </Navbar.Collapse>    

    </Navbar>
    </Container>
    </Container>
    </div>
    );
};

export default Home1;
